def plot_ts_runs(arr_a, tarr_a, col, mark, s, start_arr):
	print("PLOTTING TS for runs of ", s, len(arr_a), len(tarr_a))
	for a,t,sa in zip(arr_a, tarr_a, start_arr):
		print("plotting arr i...")
		plot_ts(a,t,col,mark,s,sa)

def plot_slot_wise(dict_arr_dict, slot_sz, metr, keys_to_plot, aggregate_type, goodlabels):
	fig = plt.figure()
	ax1 = fig.add_subplot(111)
	ind=0
	max_num = 0.0
	for k in keys_to_plot:
		print("PLOTTING for ", k)
		slot_sum = {}
		slot_ct = {}
		slot_arr = {}
		for run_dict in dict_arr_dict[k]: # run_dict is a dict.
			# print(run_dict.keys(), "KEYS of rd for ", k)
			for rsi in run_dict.keys():
				if rsi not in slot_sum:
					slot_sum[rsi] = 0.0
					slot_ct[rsi] = 0
					slot_arr[rsi] = []
				slot_sum[rsi] += (run_dict[rsi])
				slot_ct[rsi] += 1
				slot_arr[rsi].append( (run_dict[rsi]) )
		slot_id_arr = sorted(slot_sum.keys())

		filtered_slot_id_arr = list(filter(lambda x: len(slot_arr[x]) > 4, slot_id_arr))
		print("for ", k , " metric ", metr, " slots with >=5runs: ", filtered_slot_id_arr)
		slot_x = [ (slot_sz*(sss+1)) for sss in filtered_slot_id_arr ]
		slot_avg = [ (slot_sum[sss]/slot_ct[sss]) for sss in filtered_slot_id_arr ]
		slot_med = [ np.median( slot_arr[sss] ) for sss in filtered_slot_id_arr ]
		slot_tail = [np.percentile( slot_arr[sss], 95) for sss in filtered_slot_id_arr]

		if aggregate_type == "Avg":
			ax1.plot(slot_x, slot_avg, '^-', color=dcolors[ind], lw=2.0,  ms=6, mec=dcolors[ind], label=goodlabels[k])
			max_num = max( max(slot_avg), max_num)
		elif aggregate_type == "Median":
			ax1.plot(slot_x, slot_med, '^-', color=dcolors[ind], lw=2.0,  ms=6, mec=dcolors[ind], label=goodlabels[k])
			max_num = max( max(slot_med), max_num)
		ind += 1
	plt_title = aggregate_type + " of Yolo " + metr + "(per 10s " + per_slot_agg + ") vs time" # " over slot:" + 
	fontsz = 23
	legsz = 21
	# plt.title(plt_title, fontsize=20)
	plt.legend(loc='best', prop={"size":fontsz-2})
	plt.locator_params(axis='y', nbins=20)
	plt.locator_params(axis='x', nbins=20)
	ax1.tick_params(axis='x', which='major', labelsize=fontsz)
	ax1.tick_params(axis='y', which='major', labelsize=fontsz)
	ax1.set_ylabel("Yolo " + metr + "(s)", fontsize=fontsz)
	ax1.set_xlabel('Real Time (s)', fontsize=fontsz)
	ax1.grid(True)
	plt.ylim(0.0, max_num*1.05)
	plt.savefig(plots_absdir+"/"+plots_folder+"Yolo_NO_2c"+ plt_title + ".pdf")
	 # "/Users/aaditi2/Desktop/Robotics Project/2020/HotOS/Final Plots SOSP 21/Yolo_NO_1c_2c"+ plt_title + ".pdf")
	plt.show()

